function Print() {

    var pdf = require("html-pdf")

    var conteudo = `

        <h1 style="colo: red"> Teste Impressão</h1>
        <hr/>
        <p> Conteúido CPF </p>

    `

    pdf.create(conteudo, {}.toFile("/myPDF.pdf", (err, res) => {

        if (err) {
            console.log("Ocorreu um erro")
        } else {
            console.log(res)
        }


    }))

}

export default Print
